import React, { useState, useEffect, useFetch } from 'react';
import './style.css';
import { WatchlistContext } from '../Provider/Watchlistprovider';
import { Link } from 'react-router-dom';
import defaultPoster from '../MovieCard/default_poster.jpg';
import axios from 'axios';

export default function MovieCard() {
  let [watchlist] = useFetch('http://localhost:8080/watchlist');
